import React from 'react'
import './styles.css'

interface Props {
    todo: string,
    setTodo: React.Dispatch<React.SetStateAction<string>>
}

const InputField: React.FC<Props> = ({ todo, setTodo }) => {
    return <form className='input'>
        <input type="input"
            value={todo}
            onChange={
                (e) => setTodo(e.target.value) //setTodo is a function that takes a string and sets the todo state to that string
            }
            placeholder='Enter a task' className='input_box' />
    </form>
}

export default InputField
